import React from 'react';
import Card from './Card';

const CardList = ({robotsInCard}) => {
	const cardComponent = robotsInCard.map((user,i) => {
		return <Card id={rrobotsInCard[i].id} name={robotsInCard[i].name} email={robotsInCard[i].email} />
	})
	return (
		<div>
			{cardComponent}
		</div> 
	);
};



export default CardList;
